<html>
	<head>
		<script>
			function changeSelectedFrameIndex(v) {
				localStorage.setItem("bitty.synth.selectedFrameIndex", v);
				var arr = document.getElementById("arrow");
				arr.style.left = 16 * v;
			}

			// Get the Canvas Number from URL information
			localStorage.setItem("bitty.synth.selectedFrameIndex", 0)

			// val: the property p in "canvas.html?p=x"
			function parseURL(val) {
				var result = "Not Found",
					tmp = [];
				var items = location.search.substr(1).split("&");
				for (var index = 0; index < items.length; index++) {
					tmp = items[index].split("=");
					if (tmp[0] === val) result = decodeURIComponent(tmp[1]);
				}
				return result;
			}

			// The canvas number is determined by the "?canvasn=value" in the URL
			var canvasNumber = parseURL("canvasn");

			// Procedurally generate the seek according to the canvas count.
			var color1; 			// lightest color
			var color2; 			// ligher color
			var selectioncolor; 	// color corresponding to the canvas

			// Adjust the colors first
			switch (parseInt(canvasNumber)){
				case 1:
					selectioncolor = "#00FFFF";
					color2 = "#C4FFFF"
					color1 = "#EAFFFF"
					break;
				case 2:
					selectioncolor = "#7FFF00";
					color2 = "#CAFF96";
					color1 = "#EEFFDD";
					break;
				case 3:
					selectioncolor = "#DC143C";
					color2 = "#D899A7";
					color1 = "#D6CFD1";
					break;
				case 4:
					selectioncolor = "#FF8C00";
					color2 = "#FFC889";
					color1 = "#FFF4E8";
					break;
				case 5:
					selectioncolor = "#483D8B";
					color2 = "#B4AAFF";
					color1 = "#E8E5FF";
					break;
			}

			// Append seek div elements, each with their color.

			var seekDiv = document.getElementById("seek");
			var tString = "";
			var col;

			document.write("<style> div.ska {transition: background-color 0.15s; background-color: " + color1 + ";} div.ska:hover {background-color: #0094FF;}</style>");
			document.write("<style> div.skb {transition: background-color 0.15s; background-color: " + color2 + ";} div.skb:hover {background-color: #0094FF;}</style>");
			document.write("<style> div.centerelement {position: relative;top: 50%; transform: translateY(-50%);} </style>")

		</script>
	</head>

		<script>

			function loadFile(canvasn, framen) {
				var a = [];
				var loadString = localStorage.getItem("bitty.synth." + canvasn + "." + framen);
				if (loadString == null || loadString == "null" || loadString=="{}" || loadString=="{,}") return a;
				loadString = loadString.substring(1, loadString.length - 1);
				a = loadString.split(",");
				return(a);
			}

			// Routinely adjust seek waveform
			function adjustSeek(){
				// Load canvas contents that exist and check for longest one
				var maxLength = -1;
				for (var i = 0; i < 2000; i++) {
					var frameCtx = loadFile(canvasNumber, i);
					if (frameCtx.length > maxLength) maxLength = parseInt(frameCtx.length);
				}
				// Draw each seek waveform
				for (var i = 0; i < 2000; i++) {
					var frameCtx = loadFile(canvasNumber, i);
					var waveFHeight = parseInt(frameCtx.length / maxLength * 80) + "%";
					var divHTML = "<div class=\"centerelement\" style=\"border-radius:15%; background-color:" + selectioncolor + "; width:100%; height:" + waveFHeight + "; " + "\"></div>";
					if (divHTML!=document.getElementById("seek" + i).innerHTML) {
						document.getElementById("seek" + i).innerHTML = divHTML;
					}
				}
				// Update arrow
				var v = localStorage.getItem("bitty.synth.selectedFrameIndex");
				var arr = document.getElementById("arrow");
				arr.style.left = 16 * v;
			}

			setInterval(adjustSeek, 800);
		</script>
